import React from "react";




function Footer(){

    const date = new Date();
    const currentYear = date.getFullYear();
    console.log(currentYear);

    return (
    <div className="Footer">
    <p className="Footer p">Copyright @ {currentYear} </p>
    </div>);


    };








export default Footer;
